import './Homepage.css';

function Homepage() {
    return(
      <main className="mainSection">
        <article className="mainArticle">
            <h1>Naslov</h1>
            <p>Text</p>
            <p>Autor</p>
        </article>
      </main>
    );
};

export default Homepage;
